import Head from 'next/head'
import BagState from '../components/Bag.js'

export default function Bag() {
    const { items } = BagState
    return (
        <div className="container">
            <Head>
                <title>Bag</title>
                <link rel="icon" href="/favicon.ico" />
            </Head>

            <main>
                <ul>
                    {items.map(item => (
                        <li>item.name</li>
                    ))}
                </ul>
            </main>
        </div>
    )
}
